import { Link } from "react-router-dom";

function Bottom() {
  return (
    <div className="Bottom">
      <center>
        <img src={"/img/btnChange.png"}></img>
        <button className="Departure">출발지</button>
        <br></br>
        <button className="Arrival">도착지</button>
      </center>
    </div>
  );
}

export default Bottom;
